        <h1>Cat√°logo de produtos</h1>
      </div>
      <div className="row">
        {page?.content.map(product => {
          
        })}
        <div className="col-sm-6 col-lg-4 col-xl-3">
          <Link to="/products/1">
            <ProductCard product={product} />
          </Link>
        </div>
        
      </div>
      <div className="row">
        <Pagination />
      </div>
    </div>
  );
};
export default Catalog;
